import React from 'react';
import { Form } from 'antd';

const dummy = {
    isLoggedIn: true,
};

const Home = () => {
  return (
    <div>
        {dummy.isLoggedIn &&
            <Form encType="multipart/form-data">
                <Input.TextArea maxLength={140} placeholder="일상을 적어주세요." />
            </Form> 
        }
    </div>
  );
};

export default Home;
